import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // Wait for and fill search input
    const searchInput = await page.waitForSelector('#searchInput', { timeout: 5000 });
    await searchInput.fill('iPhone');

    // Take screenshot after filling search
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_search_filled.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_search_filled.png'));

    // Click search button using different selector strategy
    const searchBtn = await page.waitForSelector('.search-btn', { timeout: 5000 });
    await searchBtn.click();

    // Wait for search results to appear
    await page.waitForSelector('.products-grid, .products-list, .search-results', { timeout: 5000 });

    // Take screenshot after search
    await page.screenshot({ path: path.join(screenshotsDir, 'step_3_search_results.png') });
    screenshots.push(path.join(screenshotsDir, 'step_3_search_results.png'));

    // Extract search results data
    const resultsCount = await page.evaluate(() => {
      const countEl = document.querySelector('.results-count');
      return countEl ? countEl.textContent : 'Results count not found';
    });

    const productTitles = await page.evaluate(() => {
      const titles = Array.from(document.querySelectorAll('.product-title'));
      return titles.slice(0, 5).map(title => title.textContent.trim());
    });

    return {
      success: true,
      action: "Successfully searched for 'iPhone' products and captured results",
      extractedData: {
        resultsCount,
        firstFiveProducts: productTitles
      },
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to complete task",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}
